import React,{useEffect, useState} from "react";


const BaseUrl='https://www.thecocktaildb.com/api/json/v1/1/search.php?s=margarita';

// interface Drink {
//     idDrink: string;
//     title: string;
// }

const CockTailBar=()=>{
    const  [drinks, setDrinks]= useState([]);

    useEffect(()=>{
        const fetchDrinks= async ()=>{
            const response= await fetch(`${BaseUrl}/drinks`);
            const drinks=await response.json();
            setDrinks(drinks.drinks); // Assuming the API response has a 'drinks' property
        }
        fetchDrinks();
    },[])
    return (
        <div>
            <h1>Available Coctails</h1>
            {drinks && (
                <ul>
                    {drinks.map((drink)=>{
                        return <li>{drink.idDrink}</li>
                    })}
                </ul>
            )}
        </div>
    )
}
export default CockTailBar;
